import React from 'react';
import ReactPlayer from 'react-player';
import './YoutubeEmbed.css';

const YouTubeEmbed = () => (
        <div className="Player">
            <ReactPlayer
            url="https://www.youtube.com/watch?v=S8GpX3SAeig"
            controls="on"
            width="500px"
            height="300px"
            volume="0.69" />
            {/* <iframe url="https://open.spotify.com/playlist/4piFGW6mUnAK9hcsR0135f?si=cee7d44c101e4c33"></iframe> */}
        </div>
);

export default YouTubeEmbed;
